import React from 'react'

function BankComponent({banks}) {
  const bankElements = banks.map(bank=>{
    return <div>
      <h3 id = "bank_name">{bank.bank_name}</h3>
      </div>
  })
  return (
    <div>
      <div>{bankElements}</div>
      <h3>{banks.map(bank=>{
        return <div>
          <h3>{`${bank.bank_name} Accounts`}</h3>
          {bank.account_type}
        </div>
      })}</h3>
    </div>
  )
}

export default BankComponent
